import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Footer from "./Footer";

function App() {
  return (
    <Router>

        <Routes>
          <Route path="/" element={<Footer />} ></Route>
        </Routes>
      </Router>
  );
}

export default App;
